import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from 'react'

const data = (setData) => { 
  fetch("https://datausa.io/api/data?drilldowns=Nation&measures=Population").then(function (response) {
    return response.json();
  }).then(function (response) {
    console.log('-----', response)
    setData(response.data);
  })
}

function Draw({fetch_data}) {
  console.log(fetch_data)
  return <table>
    {fetch_data && fetch_data.length && fetch_data.map( data => {
      <tr>
        { data?.map( obj => {
          return <td> {obj} </td>
        } ) }
      </tr>
    } ) }
  </table>
}

function App() {
  const [fetch_data, setData] = useState([]);
  useEffect(() => {
    data(setData);
  }, []);
  console.log(fetch_data)
  return (
    <div className="App">
      <Draw fetch_data={fetch_data} />
    </div>
  );
